import React from 'react'
import '../App.css';
import { Barcontente } from './barcontente';
function Sidebar() {
  return (
    <div className='sidebar'>
      <ul className='barlist'>
        {Barcontente.map((val,key) => {
          return (
            <li key={key} >
              <div>{val.icon}</div>
              <div>{val.title }</div>
            </li>
          )
        })}
      </ul>
    </div>
  )
}

export default Sidebar;
